import introimg from '../images/introduction.jpg';
import React, { Component } from 'react';

class Intro extends Component {
    render() {
        return (
            <div>
                <img className="introbg" src={introimg} alt="Profile"></img>
            </div>
        )
    }
}

export default Intro;
